import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import App from './App';
import * as serviceWorker from './serviceWorker';
import 'tachyons';

ReactDOM.render(
                <CardList robots={ robots } />
, document.getElementById('root'));

serviceWorker.unregister();
